#include "XdevLWindowCocoa.h"extern xdl::XdevLPluginDescriptor windowCarbonPluginDescriptor;extern xdl::XdevLModuleDescriptor windowCocoaModuleDesc;extern xdl::XdevLModuleDescriptor windowServerModuleDesc;extern xdl::XdevLModuleDescriptor windowEventServerModuleDesc;extern xdl::XdevLModuleDescriptor cursorModuleDesc;XDEVL_PLUGIN_INIT {	return xdl::XdevLWindowCocoa::initCocoa(XDEVL_PLUGIN_CREATE_PARAMETER_MEDIATOR);}XDEVL_PLUGIN_SHUTDOWN {	return xdl::XdevLWindowCocoa::shutdownCocoa();}XDEVL_PLUGIN_CREATE_MODULE  {	XDEVL_PLUGIN_CREATE_MODULE_INSTANCE(xdl::XdevLWindowCocoa, windowCocoaModuleDesc)	XDEVL_PLUGIN_CREATE_MODULE_INSTANCE(xdl::XdevLWindowServerCocoa, windowServerModuleDesc)	XDEVL_PLUGIN_CREATE_MODULE_INSTANCE(xdl::XdevLWindowCocoaEventServer, windowEventServerModuleDesc)	XDEVL_PLUGIN_CREATE_MODULE_INSTANCE(xdl::XdevLCursorCocoa, cursorModuleDesc)	XDEVL_PLUGIN_CREATE_MODULE_NOT_FOUND}XDEVL_PLUGIN_DELETE_MODULE_DEFAULTXDEVL_PLUGIN_GET_DESCRIPTOR_DEFAULT(windowCarbonPluginDescriptor);